import React from 'react';
import api from '../../api/api';
import './dashboard.css';
import { Button } from 'react-bootstrap';

class Dashboard extends React.Component {

  constructor(props) {
    super(props);

    this.state = { loaded: false }
  }

  async componentWillMount() {
    const { data } = await api.get("user/");
    this.setState({ user: data, loaded: true });
  }

  render() {
    if (!this.state.loaded) {
      return (
        <div>
          <p>Loading...</p>
        </div>
      );
    }
    return (
      <div>
        <h1 id="dashboardTitle">Welcome back, {this.state.user.email}!</h1>
          <Button variant="primary" type="submit" style={{backgroundColor: '#4f92ff', marginRight: '45%', marginLeft: '45%', paddingTop: "30px"}}>Register</Button>
      </div>
    );
  }
}


export default Dashboard;
